package isola.model.ext.tree;import isola.helpers.JsHelper;import isola.model.ext.base.Observable;/** *  * The default single selection for a TreePanel. *  *  *  * @author Umut Gokbayrak */public class DefaultSelectionModel extends Observable {	private static final long serialVersionUID = -4296969665407009745L;	private static final String TAG = "Ext.tree.DefaultSelectionModel";		public DefaultSelectionModel() {		super();	}		@Override	protected void _postProcessToString() {		super._postProcessToString();	}		@Override	public String toString() {		_postProcessToString();		return "new " + TAG + "(" + JsHelper.printJsObject(this) + ")";	}}